description:
Maison d'architecte Nantes Erdre 197 m² habitables sur parcelle de 680 m². Maison lumineuse en parfait état permettant, grâce à ses nombreuses ouvertures de profiter du jardin arboré orienté Ouest. Elle est distribuée sur deux niveaux avec, au rez de chaussée une entrée, une pièce de vie de 43 m² avec baies vitrées sur la terrasse avec pergola, ouverte sur la cuisine aménagée avec plans de travail en granit, une arrière cuisine, une chambre, une salle d'eau et un WC. A l'étage, une mezzanine, trois chambres, une salle de bain avec baignoire et douche, un WC et un dressing. En plus, un garage double. Le tout situé dans un quartier très calme de Saint-Joseph-de Porterie à 3 mn d'un arrêt de chrono bus C6. Pour vous accompagner dans votre projet, contactez - DE PONNAT Ariane - - Ou par courriel à (réf. 7401420968)
